import { useState, useEffect } from "react";
import axios from "axios";
import { Flex } from "antd";
import HcpTable from "./components/HcpTable";

const App = () => {
  const [hcpData, setHcpData] = useState(null);
  const [selectedTableRow, setSelectedTableRow] = useState(null);

  useEffect(() => {
    fetchHcps();
  }, []);

  const fetchHcps = async () => {
    try {
      // TODO abstract to api file
      const response = await axios.get("http://localhost:8000/hcps/");
      // TODO why await this?
      const data = response.data.hcps;
      // console.log("DATA", data);
      setHcpData(data);
    } catch (error) {
      // TODO show message
      // Send to Sentry etc
      console.log("error", error);
    }
  };

  const handleSelectedTableRowChange = async (selectedRecord) => {
    try {
      // TODO add try catch with message
      const recordId = selectedRecord?.id;
      // TODO abstract to api file
      const response = await axios.get(
        `http://localhost:8000/hcps/${recordId}`
      );
      // TODO why await this?
      const data = response?.data;
      setSelectedTableRow(data);
    } catch (error) {
      // TODO show message
      // Send to Sentry etc
      console.log("error", error);
    }
  };

  return (
    <Flex justify="center">
      <HcpTable data={hcpData} onSelectRow={handleSelectedTableRowChange} />
    </Flex>
  );
};

export default App;
